<!DOCTYPE html>
<html lang="id">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Produk Otomotif - Perusahaan Otomotif</title>
    <style>
        /* Reset margin dan padding */
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Arial', sans-serif;
            background-color: #f4f4f4;
            color: #333;
        }

        /* Navbar Styling */
        nav {
            background-color: #333;
            padding: 15px;
            text-align: center;
        }

        nav ul {
            list-style-type: none;
            padding: 0;
        }

        nav ul li {
            display: inline;
            margin: 0 15px;
        }

        nav ul li a {
            color: white;
            text-decoration: none;
            font-size: 18px;
        }

        nav ul li a:hover {
            text-decoration: underline;
        }

        /* Header Section */
        header {
            background-color: #2a2a2a;
            color: white;
            padding: 60px 20px;
            text-align: center;
        }

        header h1 {
            font-size: 3em;
            margin-bottom: 10px;
        }

        header p {
            font-size: 1.2em;
        }

        /* Product Section */
        .product-section {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
            gap: 20px;
            padding: 50px 20px;
            max-width: 1200px;
            margin: 0 auto;
        }

        .product-card {
            background-color: white;
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
            text-align: center;
            transition: transform 0.3s;
        }

        .product-card:hover {
            transform: scale(1.05);
        }

        .product-card img {
            width: 100%;
            height: auto;
            border-radius: 8px;
        }

        .product-card h3 {
            font-size: 1.8em;
            margin-top: 15px;
        }

        .product-card p {
            font-size: 1em;
            color: #555;
            margin: 10px 0;
        }

        .product-card button {
            padding: 10px 20px;
            background-color: #333;
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            font-size: 1em;
            transition: background-color 0.3s;
        }

        .product-card button:hover {
            background-color: #555;
        }

        /* Footer Section */
        footer {
            background-color: #333;
            color: white;
            text-align: center;
            padding: 10px 0;
            margin-top: 50px;
        }

        /* Responsiveness */
        @media (max-width: 768px) {
            header h1 {
                font-size: 2.5em;
            }

            header p {
                font-size: 1.1em;
            }

            .product-card {
                padding: 15px;
            }

            .product-card h3 {
                font-size: 1.5em;
            }

            .product-card p {
                font-size: 0.9em;
            }
        }
    </style>
</head>
<body>

    <!-- Navbar -->
    <nav>
        <ul>
            <li><a href="home">home</a></li>
            <li><a href="about">About</a></li>
            <li><a href="contact">Contact</a></li>
            <li><a href="product">Product</a></li>
        </ul>
    </nav>

    <!-- Header -->
    <header>
        <h1>Produk Otomotif Kami</h1>
        <p>Menawarkan berbagai produk berkualitas untuk kebutuhan otomotif Anda</p>
    </header>

    <!-- Product Section -->
    <section class="product-section" id="product">
        <!-- Product 1 -->
        <div class="product-card">
            <img src="http://ts3.mm.bing.net/th?id=OIP.U5MpIrXGqTWAI058NCNz7gHaE5&pid=15.1" alt="Mobil SUV">
            <h3>Mobil SUV 2025</h3>
            <p>Mobil SUV dengan fitur canggih, desain elegan, dan performa terbaik. Ideal untuk perjalanan jauh dan petualangan.</p>
            <button>Lihat Detail</button>
        </div>

        <!-- Product 2 -->
        <div class="product-card">
            <img src="data:image/jpeg;base64," alt="Motor Sport">
            <h3>mobil Sport </h3>
            <p>Mobil sport dengan kecepatan tinggi dan teknologi mesin terbaru. Dirancang untuk pengendara yang menyukai tantangan.</p>
            <button>Lihat Detail</button>
        </div>

        <!-- Product 3 -->
        <div class="product-card">
            <img src="data:image/jpeg;base64," alt="Mobil Sedan">
            <h3>Mobil Sedan Elegan</h3>
            <p>Mobil sedan mewah dengan kenyamanan optimal dan fitur modern. Cocok untuk perjalanan bisnis dan keluarga.</p>
            <button>Lihat Detail</button>
        </div>

        <!-- Product 4 -->
        <div class="product-card">
            <img src="data:image/jpeg;base64," alt="Motor Cruiser">
            <h3>Motor Cruiser Z500</h3>
            <p>Motor cruiser yang nyaman dengan desain klasik dan performa tangguh. Cocok untuk perjalanan santai di jalanan terbuka.</p>
            <button>Lihat Detail</button>
        </div>

        <!-- Product 5 -->
        <div class="product-card">
            <img src="https://th.bing.com/th/id/OIP.Pa6ChjUYCQf1VsMImAlXDAHaE8?w=244&h=180&c=7&r=0&o=5&pid=1.7" alt="Mobil Hatchback">
            <h3>Mobil Hatchback 2025</h3>
            <p>Mobil hatchback kompak dengan efisiensi bahan bakar terbaik dan ruang yang luas untuk keluarga muda.</p>
            <button>Lihat Detail</button>
        </div>

        <!-- Product 6 -->
        <div class="product-card">
            <img src="data:image/jpeg;base64," alt="Aksesori Mobil">
            <h3>Aksesori Mobil Premium</h3>
            <p>Aksesori mobil terbaik untuk menambah kenyamanan dan tampilan kendaraan Anda. Tersedia berbagai pilihan.</p>
            <button>Lihat Detail</button>
        </div>
    </section>

    <!-- Footer -->
    <footer>
        <p>&copy; 2025 Perusahaan Otomotif | Semua Hak Dilindungi</p>
    </footer>

</body>
</html>
